==Trivia==
*When asked for another banner, he is referred to as a 'child-shaped entity'.
*His name and examine text are likely a reference to one of the conversations that can be had with [[Gnome Child]]ren, where the player character asks a Gnome Child if there is a god and the child responds "There is now!"

